const UserItem = ({user}) => {
    window.console.log(user)
    return (
        <tr>
            {/*<td>*/}
            {/*    {user.username}*/}
            {/*</td>*/}
            {/*<td>*/}
            {/*    {user.first_name}*/}
            {/*</td>*/}
            {/*<td>*/}
            {/*    {user.last_name}*/}
            {/*</td>*/}
            {/*<td>*/}
            {/*    {user.email}*/}
            {/*</td>*/}
        </tr>
    )
}


const UserList = ({users}) => {
    window.console.log(users)
    return (
        <table>
            <th>
                Username
            </th>
            <th>
                First name
            </th>
            <th>
                Last Name
            </th>
            <th>
                Email
            </th>
            {/*{users.map((user) => <UserItem user={user}/>)}*/}
        </table>
    )
}

export default UserList
